function getWordFromNode(node) {
	const wordNode = node.querySelector(".dictLink");
	const found = [];
	for(let i = 0; i < wordNode.childNodes.length; i++) {
		const n = wordNode.childNodes[i];
		const next = wordNode.childNodes[i + 1];
		if(n.nodeType == Node.TEXT_NODE
			&& n.textContent.trim() !== ''
			&& (next == null || !/grammar_info|placeholder/.test(next.className))) {
			found.push(n.textContent);
		}
	}
	if(found.length !== 1) {
		throw new Error("Could not determine word in node. Found: " + JSON.stringify(found));
	}
	return found.join(' ').trim();
}

